import { createSelector } from "@reduxjs/toolkit";
import _ from "lodash";

export const getUser = (state) => _.get(state, "user", null);
export const getName = (state) => _.get(state, name, null);
export const getBirthday = (state) => _.get(state, birthday, null);
export const getGender = (state) => _.get(state, gender, null);
export const getRace = (state) => _.get(state, race, null);
export const getReligion = (state) => _.get(state, religion, null);
export const getAddress = (state) => _.get(state, address, null);
export const getTelNo = (state) => _.get(state, tel_no, null);
export const getHpNo = (state) => _.get(state, hp_no, null);
export const getEmail = (state) => _.get(state, email, null);
export const getSchoolId = (state) => _.get(state, school_id, null);
export const getDisability = (state) => _.get(state, disability, null);
